import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { loginUser } from "../api";
import { validateEmail, validatePassword } from "../utils";

export default function Login({ setToken, setRole }) {
    const navigate = useNavigate();
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState("");

    const handleLogin = async (e) => {
        e.preventDefault();
        setError("");

        if (!validateEmail(email) || !validatePassword(password)) {
            setError("Please enter a valid email and password (min 6 characters).");
            return;
        }

        setLoading(true);
        try {
            const userData = await loginUser({ email, password });

            if (userData.token) {
                localStorage.setItem("token", userData.token);
                setToken(userData.token);
            }
            if (userData.role) {
                localStorage.setItem("role", userData.role.toUpperCase());
                setRole(userData.role.toUpperCase());
            }
            if (userData.id) localStorage.setItem("userId", userData.id);

            const roleUpper = (userData.role || "").toUpperCase();
            if (roleUpper === "ADMIN") navigate("/manage-users", { replace: true });
            else if (roleUpper === "CLIENT") navigate("/dashboard", { replace: true });
            else if (roleUpper === "FREELANCER") navigate("/freelancer-dashboard", { replace: true });
            else navigate("/login", { replace: true });

        } catch (err) {
            console.error("Login failed:", err);
            setError("Invalid credentials. Please try again.");
        } finally {
            setLoading(false);
        }
    };

    return (
        <div style={styles.container}>
            <div style={styles.card}>
                <h2 style={styles.brand}>FreelanceHub</h2>
                <p style={styles.subtitle}>Sign in to your account</p>

                {error && <p style={styles.error}>{error}</p>}

                <form onSubmit={handleLogin}>
                    <input
                        type="email"
                        placeholder="Email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        style={styles.input}
                    />
                    <input
                        type="password"
                        placeholder="Password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        style={styles.input}
                    />

                    <button type="submit" style={styles.button} disabled={loading}>
                        {loading ? "Logging in..." : "Login"}
                    </button>
                </form>

                <div style={styles.links}>
                    <span
                        style={styles.link}
                        onClick={() => navigate("/register")}
                    >
                        Create an account
                    </span>
                    <span
                        style={styles.link}
                        onClick={() => navigate("/forgot-password")}
                    >
                        Forgot password?
                    </span>
                </div>
            </div>
        </div>
    );
}

const styles = {
    container: {
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100vh",
        background: "#f4f6f9",
        fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    },
    card: {
        background: "#fff",
        padding: "40px 35px",
        borderRadius: "12px",
        boxShadow: "0 4px 20px rgba(0,0,0,0.08)",
        width: "350px",
        textAlign: "center",
    },
    brand: {
        fontSize: "24px",
        fontWeight: "600",
        color: "#007BFF",
        marginBottom: "10px",
    },
    subtitle: {
        fontSize: "14px",
        color: "#666",
        marginBottom: "20px",
    },
    input: {
        width: "100%",
        padding: "12px",
        margin: "10px 0",
        border: "1px solid #ddd",
        borderRadius: "8px",
        fontSize: "14px",
        outline: "none",
    },
    button: {
        width: "100%",
        padding: "12px",
        marginTop: "15px",
        backgroundColor: "#007BFF",
        color: "#fff",
        border: "none",
        borderRadius: "8px",
        cursor: "pointer",
        fontSize: "15px",
        fontWeight: "500",
        transition: "0.2s",
    },
    error: { color: "red", fontSize: "14px", marginBottom: "10px" },
    links: {
        marginTop: "15px",
        display: "flex",
        justifyContent: "space-between",
        fontSize: "13px",
        color: "#555",
    },
    link: {
        color: "#007BFF",
        cursor: "pointer",
        textDecoration: "underline",
    },
};
